import React from "react";
import "./Header.css";
import { Link } from "react-router-dom";

function Header() {
  return (
    <header>
      <div className="container">
        <h1>Drxck's Portfolio</h1>
        <nav>
          <ul>
          <Link to="/"> Home </Link>
          <Link to="/Projects"> Projects </Link>
          <Link to="/Contact"> Contact </Link>
          </ul>
        </nav>
      </div>
    </header>
  );
}

export default Header;
